import React from 'react';
import 'bulma/css/bulma.css';
import _ from 'underscore'

function App() {
  return (
    <div className="">
    <div className="buttons">
      <button className="button is-info is-small">Info</button>
      <button className="button is-success is-normal">Success</button>
      <button className="button is-warning is-medium">Warning</button>
      <button className="button is-danger is-large">Danger</button>
  </div>
    </div>

  );
}

export default App;
